CREATE DATABASE IF NOT EXISTS TravEasy;

USE TravEasy;

-- Create table TravEasy_strong_entities
CREATE TABLE IF NOT EXISTS TravEasy_strong_entities (
    customerId VARCHAR(255),
    street VARCHAR(255),
    city VARCHAR(255),
    state VARCHAR(255),
    zipcode VARCHAR(255),
    email VARCHAR(255),
    name VARCHAR(255),
    restaurantId VARCHAR(255),
    restaurant_name VARCHAR(255),
    restaurant_location VARCHAR(255),
    restaurant_price VARCHAR(255),
    navigationId VARCHAR(255),
    navigation_distance INTEGER,
    navigation_fare INTEGER,
    estimated_time TIME,
    transportation_method VARCHAR(255),
    routing TEXT,
    hotelId VARCHAR(255),
    amentities TEXT,
    hotel_street VARCHAR(255),
    hotel_city VARCHAR(255),
    hotel_state VARCHAR(255),
    hotel_zipcode VARCHAR(255),
    duration_of_stay INTEGER,
    hotel_rating INTEGER,
    room_type_Id VARCHAR(255),
    room_type_name VARCHAR(255),
    max_guest INTEGER,
    total_rooms INTEGER,
    room_type_description TEXT,
    room_price INTEGER,
    ticketID VARCHAR(255),
    flight_class VARCHAR(255),
    customerName VARCHAR(255),
    flight_cost INTEGER,
    paymentId VARCHAR(255),
    payment_amount INTEGER,
    payment_type VARCHAR(255),
    transaction_assure BOOLEAN,
    theft_prevention BOOLEAN,
    flight_number INTEGER,
    flight_total_seats INTEGER,
    flight_duration INTEGER,
    flight_departure_location VARCHAR(255),
    flight_arrival_time TIMESTAMP,
    flight_arrival_location VARCHAR(255),
    flight_departure_time TIMESTAMP,
    airline_name VARCHAR(255),
    airline_contact_information VARCHAR(255),
    flight_class_id VARCHAR(255),
    flight_class_fare INTEGER,
    flight_class_type VARCHAR(255)
);

-- Create table TravEasy_weak_entities
CREATE TABLE IF NOT EXISTS TravEasy_weak_entities (
    cuisineID VARCHAR(255),
    cuisine_description TEXT,
    cuisine_type VARCHAR(255),
    restaurant_booked_ID VARCHAR(255),
    restaurant_booked_participants INTEGER,
    restaurant_booked_datatime DATETIME,
    activitiesID VARCHAR(255),
    activities_name VARCHAR(255),
    activities_cost INTEGER,
    customerID VARCHAR(255),
    customer_demographics_type TEXT
 );

-- Create table TravEasy_bridge_entities    
CREATE TABLE IF NOT EXISTS TravEasy_bridge_entities (
    activitiesID VARCHAR(255),
    customerID VARCHAR(255),
    cuisineID VARCHAR(255),
    restaurantId VARCHAR(255),
    navigationId VARCHAR(255),
    transportation_method VARCHAR(255)
);

